import React from "react";
import Logo from "../images/test2.png"

const Login = () => {
  return (
    // <div className="flex flex-col w-full max-w-md p-12 space-y-4 text-center dark:bg-transparent dark:text-black">
    //   <h1 className="text-3xl font-semibold">Slug Finance - Sign In</h1>
    //   <form novalidate="" className="space-y-4 ng-untouched ng-pristine ng-valid">
    //     <div className="flex flex-col space-y-4">
    //       <label for="email" className="sr-only">Email address</label>
    //       <input id="email" type="email" placeholder="Email address" className="rounded-none dark:border-gray-600 dark:bg-transparent dark:text-black focus:ring-violet-400 focus:dark:border-violet-400 focus:outline-none" />
    //       <label for="password" className="sr-only">Password</label>
    //       <input id="password" type="text" placeholder="Password" className="rounded-none dark:border-gray-600 dark:bg-transparent dark:text-black focus:ring-violet-400 focus:dark:border-violet-400 focus:outline-none" />
    //     </div>
    //     <div className="flex justify-between">
    //       <div className="flex items-center">
    //         <input type="checkbox" name="remember" id="remember" aria-label="Remember me" className="mr-1 rounded-sm focus:ring-violet-400 focus:dark:border-violet-400 focus:outline-none accent-violet-400" />
    //         <label for="remember" className="text-sm dark:text-gray-400">Remember me</label>
    //       </div>
    //     </div>
    //     <button type="button" className="bg-violet-500 hover:bg-violet-600 active:bg-violet-700 px-8 py-3 space-x-2 font-semibold rounded dark:text-white">Sign in</button>
    //   </form>
    // </div>
    <div class="flex items-center min-h-screen bg-white dark:bg-gray-800">
        <div class="container mx-auto">
            <div class="max-w-md mx-auto my-0 mx-0">
                <div class="text-center">
                    <img class={Logo} alt="logo" />
                    <h1 class="my-3 text-3xl font-semibold text-gray-700 dark:text-gray-200">Sign in</h1>
                    <p class="text-gray-500 dark:text-gray-400">Sign in to access your account</p>
                </div>
                <div class="m-7">
                    <form action="">
                        <div class="mb-6">
                            <label for="email" class="block mb-2 text-sm text-gray-600 dark:text-gray-400">Email Address</label>
                            <input type="email" name="email" id="email" placeholder="user@ucsc.edu" class="w-full px-3 py-2 placeholder-gray-300 border border-gray-300 rounded-md focus:outline-none focus:ring focus:ring-indigo-100 focus:border-indigo-300 dark:bg-gray-700 dark:text-white dark:placeholder-gray-500 dark:border-gray-600 dark:focus:ring-gray-900 dark:focus:border-gray-500" />
                        </div>
                        <div class="mb-6">
                            <div class="flex justify-between mb-2">
                                <label for="password" class="text-sm text-gray-600 dark:text-gray-400">Password</label>
                                <a href="#!" class="text-sm text-gray-400 focus:outline-none focus:text-indigo-500 hover:text-indigo-500 dark:hover:text-indigo-300">Forgot password?</a>
                            </div>
                            <input type="password" name="password" id="password" placeholder="Enter Password" class="w-full px-3 py-2 placeholder-gray-300 border border-gray-300 rounded-md focus:outline-none focus:ring focus:ring-indigo-100 focus:border-indigo-300 dark:bg-gray-700 dark:text-white dark:placeholder-gray-500 dark:border-gray-600 dark:focus:ring-gray-900 dark:focus:border-gray-500" />
                        </div>
                        <div class="mb-6">
                          <button type="button" className="bg-violet-500 hover:bg-violet-600 active:bg-violet-700 px-8 py-3 space-x-2 font-semibold rounded dark:text-white">Sign in</button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    </div>
  )
};
  
export default Login;
